One of the early ambassadors of drum and bass in North America, STRANJAH has cemented his position in the bass music world with seminal releases on Metalheadz, 31 Records and Renegade Hardware.  His sound initially caught the attention of L Double at Flex Records in 1999 which led to a string of releases.  In the early 2000‚Äôs he worked with frequent collaborator Gremlinz, and the pair would find their music in the hands of legends Goldie and Doc Scott, which eventually would land releases on Metalheadz and 31 Records.

Recently STRANJAH has done work for massive labels such as Critical Music and Hospital Records.  Drawing from a number of influences, his sound is incredibly eclectic and essentially impossible to label under one umbrella.  His modern-day sound is best characterized by expressive bass design, 90's chord stabs and syncopated drum breaks.  STRANJAH has seen success with his new YouTube channel demystifying music production for a new generation of producers.  With his label Deviant Audio, he has made it his mission to help others succeed by providing knowledge, tools and resources to excel ones own production.

